INSERT INTO `ROUTINES` VALUES ('pr_add', 'def', 'logistics_driver', 'pr_add', 'PROCEDURE', '', null, null, null, null, null, null, null, 'SQL', 'BEGIN\r\n   DECLARE c INT;\r\n   IF a IS NULL THEN\r\n      SET a = 0;\r\n   END IF;\r\n   IF b IS NULL THEN\r\n      SET b = 0;\r\n   END IF;\r\n   SET c = a + b;\r\n   SELECT c AS SUM;\r\n    END', null, null, 'SQL', 'NO', 'CONTAINS SQL', null, 'DEFINER', '2017-05-06 13:42:33', '2017-05-06 13:42:33', 'STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION', '', 'root@%', 'utf8', 'utf8_general_ci', 'utf8_general_ci');
INSERT INTO `ROUTINES` VALUES ('getPY', 'def', 'test', 'getPY', 'FUNCTION', 'varchar', '21845', '65535', null, null, 'utf8', 'utf8_general_ci', 'varchar(21845)', 'SQL', 'BEGIN\r\n#截取字符串，每次做截取后的字符串存放在该变量中，初始为函数参数in_string值\r\nDECLARE tmp_str VARCHAR(21845) CHARSET gbk DEFAULT \'\' ; \r\n#tmp_str的长度\r\nDECLARE tmp_len SMALLINT DEFAULT 0;\r\n#tmp_str的长度\r\nDECLARE tmp_loc SMALLINT DEFAULT 0;\r\n#截取字符，每次 left(tmp_str,1) 返回值存放在该变量中\r\nDECLARE tmp_char VARCHAR(2) CHARSET gbk DEFAULT \'\';\r\n#结果字符串\r\nDECLARE tmp_rs VARCHAR(21845)CHARSET gbk DEFAULT \'\';\r\n#拼音字符，存放单个汉字对应的拼音首字符\r\nDECLARE tmp_cc VARCHAR(2) CHARSET gbk DEFAULT \'\';\r\n#初始化，将in_string赋给tmp_str\r\nSET tmp_str = in_string;\r\n#初始化长度\r\nSET tmp_len = LENGTH(tmp_str);\r\n#如果被计算的tmp_str长度大于0则进入该while\r\nWHILE tmp_len > 0 DO \r\n#获取tmp_str最左端的首个字符，注意这里是获取首个字符，该字符可能是汉字，也可能不是。\r\nSET tmp_char = LEFT(tmp_str,1);\r\n#左端首个字符赋值给拼音字符\r\nSET tmp_cc = tmp_char;\r\n#获取字符的编码范围的位置，为了确认汉字拼音首字母是那一个\r\nSET tmp_loc=INTERVAL(CONV(HEX(tmp_char),16,10),0xB0A1,0xB0C5,0xB2C1,0xB4EE,0xB6EA,0xB7A2,0xB8C1,0xB9FE,0xBBF7,0xBFA6,0xC0AC\r\n,0xC2E8,0xC4C3,0xC5B6,0xC5BE,0xC6DA,0xC8BB,0xC8F6,0xCBFA,0xCDDA ,0xCEF4,0xD1B9,0xD4D1);\r\n#判断左端首个字符是多字节还是单字节字符，要是多字节则认为是汉字且作以下拼音获取，要是单字节则不处理。如果是多字节字符但是不在对应的编码范围之内，即对应的不是大写字母则也不做处理，这样数字或者特殊字符就保持原样了\r\nIF (LENGTH(tmp_char)>1 AND tmp_loc>0 AND tmp_loc<24) THEN\r\n#获得汉字拼音首字符\r\nSELECT ELT(tmp_loc,\'A\',\'B\',\'C\',\'D\',\'E\',\'F\',\'G\',\'H\',\'J\',\'K\',\'L\',\'M\',\'N\',\'O\',\'P\',\'Q\',\'R\',\'S\',\'T\',\'W\',\'X\',\'Y\',\'Z\') INTO tmp_cc; \r\nEND IF;\r\n#将当前tmp_str左端首个字符拼音首字符与返回字符串拼接\r\nSET tmp_rs = CONCAT(tmp_rs,tmp_cc);\r\n#将tmp_str左端首字符去除\r\nSET tmp_str = SUBSTRING(tmp_str,2);\r\n#计算当前字符串长度\r\nSET tmp_len = LENGTH(tmp_str);\r\nEND WHILE;\r\n#返回结果字符串\r\nRETURN tmp_rs;\r\nEND', null, null, 'SQL', 'NO', 'CONTAINS SQL', null, 'DEFINER', '2017-06-09 14:24:50', '2017-06-09 14:24:50', 'STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION', '', 'root@%', 'utf8', 'utf8_general_ci', 'utf8_general_ci');
INSERT INTO `ROUTINES` VALUES ('getPY', 'def', 'ztwl', 'getPY', 'FUNCTION', 'mediumtext', '16777215', '16777215', null, null, 'utf8', 'utf8_general_ci', 'mediumtext', 'SQL', 'BEGIN\r\nDECLARE tmp_str VARCHAR(21845) charset gbk DEFAULT \'\' ; #截取字符串，每次做截取后的字符串存放在该变量中，初始为函数参数in_string值 \r\nDECLARE tmp_len SMALLINT DEFAULT 0;#tmp_str的长度 \r\nDECLARE tmp_char VARCHAR(2) charset gbk DEFAULT \'\';#截取字符，每次 left(tmp_str,1) 返回值存放在该变量中 \r\nDECLARE tmp_rs VARCHAR(21845) charset gbk DEFAULT \'\';#结果字符串 \r\nDECLARE tmp_cc VARCHAR(2) charset gbk DEFAULT \'\';#拼音字符，存放单个汉字对应的拼音首字符 \r\nSET tmp_str = in_string;#初始化，将in_string赋给tmp_str \r\nSET tmp_len = LENGTH(tmp_str);#初始化长度 \r\nWHILE tmp_len > 0 DO #如果被计算的tmp_str长度大于0则进入该while \r\nSET tmp_char = LEFT(tmp_str,1);#获取tmp_str最左端的首个字符，注意这里是获取首个字符，该字符可能是汉字，也可能不是。 \r\nSET tmp_cc = tmp_char;#左端首个字符赋值给拼音字符 \r\nIF LENGTH(tmp_char)>1 THEN#判断左端首个字符是多字节还是单字节字符，要是多字节则认为是汉字且作以下拼音获取，要是单字节则不处理。 \r\nSELECT ELT(INTERVAL(CONV(HEX(tmp_char),16,10),0xB0A1,0xB0C5,0xB2C1,0xB4EE,0xB6EA,0xB7A2,0xB8C1,0xB9FE,0xBBF7,0xBFA6,0xC0AC \r\n,0xC2E8,0xC4C3,0xC5B6,0xC5BE,0xC6DA,0xC8BB,0xC8F6,0xCBFA,0xCDDA ,0xCEF4,0xD1B9,0xD4D1), \r\n\'A\',\'B\',\'C\',\'D\',\'E\',\'F\',\'G\',\'H\',\'J\',\'K\',\'L\',\'M\',\'N\',\'O\',\'P\',\'Q\',\'R\',\'S\',\'T\',\'W\',\'X\',\'Y\',\'Z\') INTO tmp_cc; #获得汉字拼音首字符 \r\nEND IF; \r\nSET tmp_rs = CONCAT(tmp_rs,tmp_cc);#将当前tmp_str左端首个字符拼音首字符与返回字符串拼接 \r\nSET tmp_str = SUBSTRING(tmp_str,2);#将tmp_str左端首字符去除 \r\nSET tmp_len = LENGTH(tmp_str);#计算当前字符串长度 \r\nEND WHILE; \r\nRETURN tmp_rs;#返回结果字符串 \r\nEND', null, null, 'SQL', 'NO', 'CONTAINS SQL', null, 'DEFINER', '2017-08-03 09:30:27', '2017-08-03 09:30:27', 'STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION', '', 'root@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci');
INSERT INTO `ROUTINES` VALUES ('to_pinyin', 'def', 'ztwl', 'to_pinyin', 'FUNCTION', 'varchar', '255', '510', null, null, 'gbk', 'gbk_chinese_ci', 'varchar(255)', 'SQL', 'BEGIN\r\n    DECLARE mycode INT;\r\n    DECLARE tmp_lcode VARCHAR(2) CHARSET gbk;\r\n    DECLARE lcode INT;\r\n    DECLARE tmp_rcode VARCHAR(2) CHARSET gbk;\r\n    DECLARE rcode INT;\r\n    DECLARE mypy VARCHAR(255) CHARSET gbk DEFAULT \'\';\r\n    DECLARE lp INT;\r\n    SET mycode = 0;\r\n    SET lp = 1;\r\n    SET NAME = HEX(NAME);\r\n    WHILE lp < LENGTH(NAME) DO\r\n        SET tmp_lcode = SUBSTRING(NAME, lp, 2);\r\n        SET lcode = CAST(ASCII(UNHEX(tmp_lcode)) AS UNSIGNED); \r\n        SET tmp_rcode = SUBSTRING(NAME, lp + 2, 2);\r\n        SET rcode = CAST(ASCII(UNHEX(tmp_rcode)) AS UNSIGNED); \r\n        IF lcode > 128 THEN\r\n            SET mycode =65536 - lcode * 256 - rcode ;\r\n            SELECT CONCAT(mypy,pin_yin_) INTO mypy FROM t_base_pinyin WHERE CODE_ >= ABS(mycode) ORDER BY CODE_ ASC LIMIT 1;\r\n            SET lp = lp + 4;\r\n        ELSE\r\n            SET mypy = CONCAT(mypy,CHAR(CAST(ASCII(UNHEX(SUBSTRING(NAME, lp, 2))) AS UNSIGNED)));\r\n            SET lp = lp + 2;\r\n        END IF;\r\n    END WHILE;\r\n    RETURN LOWER(mypy);\r\nEND', null, null, 'SQL', 'NO', 'CONTAINS SQL', null, 'DEFINER', '2017-08-03 09:30:27', '2017-08-03 09:30:27', 'STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION', '', 'root@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci');
